import "./App.css";
import Map from "./Map";

function App() {
  useEffect(() => {
    fetch(
      "https://a.mapillary.com/v3/images?client_id=MHZvSFJXZjRWR0p0YWZpODRTMDhDbjoxOTUzYjNlMjVlMWM0NTcw"
    )
      .then((r) => r.json())
      .then((j) => console.log("here we are after the fetch", j));
  }, []);

  return (
    <div id="wrapper">
      <div class="content">
        <p>hey there!</p>
      </div>
      <div class="background">
        <Map />
      </div>
    </div>
  );
}

export default App;
